import React from 'react';
import axios from 'axios';
import {User} from "./User";

interface IProps {}

interface IState {
    users : User[]
}

class UserList extends React.Component<IProps, IState>{

    constructor(props:IProps) {
        super(props);
        this.state = {
            users : [] as User[]
        }
    }

    componentDidMount(): void {
        let dataURL: string = 'https://jsonplaceholder.typicode.com/users';
        axios.get(dataURL).then((response) => {
            this.setState({
                users : response.data
            });
        }).catch((error) => {
            console.error(error);
        });
    }

    render() {
        return (
            <React.Fragment>
                <section className="mt-3">
                    <div className="container">
                        <div className="row">
                            <div className="col">
                                <table className="table table-hover text-center table-primary table-striped">
                                    <thead>
                                    <tr>
                                        <th>SNO</th>
                                        <th>NAME</th>
                                        <th>Email</th>
                                        <th>Phone</th>
                                        <th>Website</th>
                                        <th>Location</th>
                                    </tr>
                                    </thead>
                                    <tbody>
                                    {
                                        this.state.users.length > 0 &&
                                        this.state.users.map(user => {
                                            return (
                                                <tr key={user.id}>
                                                    <td>{user.id}</td>
                                                    <td>{user.name}</td>
                                                    <td>{user.email}</td>
                                                    <td>{user.phone}</td>
                                                    <td>{user.website}</td>
                                                    <td>{user.address.city}</td>
                                                </tr>
                                            )
                                        })
                                    }
                                    </tbody>
                                </table>
                            </div>
                        </div>
                    </div>
                </section>
            </React.Fragment>
        );
    }
}
export default UserList;
